import React from "react";
import Allmw from "./Allmw";
import Navbar from "./Navbar";

const Cards = () => {
    
    
    const Carrs = Allmw;
    
    return (
        Carrs.map((val, index) => {
            return (<>
                <Navbar
                    key={index}
                    images = {val.link}
            title = {val.title}
            date = {val.Date}
            btao = {val.what}
            links = {val.Watch}
                />

            </>
            )
        })
    )
};

export default Cards;
